INSERT INTO `speech_results` VALUES ('1', '25', '1', 'The United States has long been known as a “melting pot”, because many of its people are descended from settlers who came from all over the world to make their homes in the new land. The first immigrants in American history came from England and the Netherlands. Attracted by reports of great economic opportunities and religious and political freedom, immigrants from many other countries flocked to the United States in increasing numbers, reaching a peak in the years 1880-1914. Between 1820 and 1980, the United States admitted almost 50 million immigrants.', '{\"overall_metrics\":{\"audio_length\":29.87,\"ielts_score\":6.5,\"mlr\":0.488421052631579,\"pause_duration\":2.03,\"pauses\":56,\"pte_score\":57,\"wcm\":112.48744559758956,\"word_count\":96,\"syllable_count\":161,\"phone_count\":419},\"overall_score\":\"55\",\"fidelity_class\":\"CORRECT\"}', '/storage/audio/mai-thanh-ly-1593314809.mp3', '2020-06-25 22:29:43', '2020-06-27 22:26:49');
INSERT INTO `speech_results` VALUES ('2', '25', '2', 'A jet plane crosses the continental United States from east to west in about five hours. Taking off from an Atlantic coast airport, the plane is soon flying over the gentle slopes of the Appalachian Mountains. Then, for hundreds of kilometers it crosses the fertile fields of the farm belt of the great Middle West. To the north, on clear days, passengers may see the five Great Lakes located between the United States and Canada. Continuing into the West, the plane flies over vast prairies and rough cattle-grazing country. Soon the snow-topped Rocky Mountains appear in the distance. After crossing these high ranges, the plane can almost glide down into the rich valleys of California and, finally, to a landing not far from the beaches of the Pacific Ocean.', '{\"overall_metrics\":{\"audio_length\":36.62,\"ielts_score\":6,\"mlr\":0.33454545454545453,\"pause_duration\":7.18,\"pauses\":87,\"pte_score\":50,\"wcm\":98.30693610049154,\"word_count\":129,\"syllable_count\":195,\"phone_count\":518},\"overall_score\":\"58\",\"fidelity_class\":\"CORRECT\"}', '/storage/audio/mai-thanh-ly-1593227168.mp3', '2020-06-25 23:16:53', '2020-06-26 22:06:08');
INSERT INTO `speech_results` VALUES ('3', '28', '3', 'The United States is a varied land – of forests, deserts, mountains, high flat lands and fertile plains. Almost every kind of climate may be found, but the country lies mostly in the temperate zone. Including the states of Alaska and Hawaii, the United States covers an area of 9 million square kilometers. The continental United States stretches 4,500 kilometers from Atlantic Ocean on the east to the Pacific Ocean on the west. It borders Canada on the north, and reaches south to Mexico and the Gulf of Mexico. A fast railroad train, travelling 96 kilometers an hour, takes more than 48 hours to cross the country.', '{\"overall_metrics\":{\"audio_length\":21.64,\"ielts_score\":0,\"mlr\":0.3581818181818182,\"pause_duration\":9.82,\"pauses\":32,\"pte_score\":10,\"wcm\":30.499075785582253,\"word_count\":107,\"syllable_count\":176,\"phone_count\":459},\"overall_score\":\"18\",\"fidelity_class\":\"FREE_SPEAK\"}', null, '2020-06-25 23:17:02', '2020-06-25 23:17:02');
