INSERT INTO `speech_results` VALUES ('174', '37', '27', 'The United States is a varied land – of forests, deserts, mountains, high flat lands and fertile plains. Almost every kind of climate may be found, but the country lies mostly in the temperate zone. Including the states of Alaska and Hawaii, the United States covers an area of 9 million square kilometers. The continental United States stretches 4,500 kilometers from Atlantic Ocean on the east to the Pacific Ocean on the west. It borders Canada on the north, and reaches south to Mexico and the Gulf of Mexico. A fast railroad train, travelling 96 kilometers an hour, takes more than 48 hours to cross the country.', '{\"overall_metrics\":{\"audio_length\":39.16,\"ielts_score\":6,\"mlr\":0.27346938775510204,\"pause_duration\":12.36,\"pauses\":97,\"pte_score\":50,\"wcm\":45.96527068437181,\"word_count\":111,\"syllable_count\":173,\"phone_count\":452},\"overall_score\":\"56\",\"fidelity_class\":\"CORRECT\"}', '/storage/audio/xuan-van-ha-1594290545.mp3', '2020-07-06 22:16:02', '2020-07-09 05:29:05');
